import React, { useState } from "react";
import Card from "./components/Card";
import Select from "./components/Select";

const initialDog = {
  image: 'data:image/jpeg;base64,',
  breed: {
    id: '',
    name: ''
  }
}

function App() {
  const [dog, setDog] = useState(initialDog)
	return (
		<div className='App'>
			<Select />
			<Card dog={dog}/>
		</div>
	);
}

export default App;
